    pragma solidity ^0.8;

    interface IERC721{

        function balanceOf(address owner) external view returns (uint balance);

        function ownerOf(uint tokenId) external view returns (address owner);

        function safeTransferFrom(address from, address to, uint tokenId) external;

        function safeTransferFrom(address from, address to, uint tokenId, bytes calldata data) external;

        function transferFrom(address from, address to, uint tokenId) external;

        function approve(address to, uint tokenId) external;

        function getApproved(uint tokenId) external view returns (address operator);

        function setApprovalForAll(address operator, bool _approved) external;

        function isApprovedForAll( address owner, address operator) external view returns (bool);
    }

    interface IERC721Receiver {
        function onERC721Received(address operator, address from, uint tokenId, bytes calldata data) external returns (bytes4);
    }

    contract ERC721 is IERC721 {
        event Transfer(address indexed from, address indexed to, uint indexed id);
        event Approval(address indexed owner, address indexed spender, uint indexed id);
        event ApprovalForAll(address indexed owner, address indexed operator,bool approved);

        // Mapping from token ID to owner address
        mapping(uint => address) internal _ownerOf;

        // Mapping owner address to token count
        mapping(address => uint) internal _balanceOf;

        // Mapping from token ID to approved address
        mapping(uint => address) internal _approvals;

        // Mapping from owner to operator approvals
        mapping(address => mapping(address => bool)) public isApprovedForAll;

        function ownerOf(uint id) public view returns (address owner) {
            owner = _ownerOf[id];
            require(owner != address(0), "token doesn't exist");
            return owner; 
        }

        function balanceOf(address owner) external view returns (uint) {
            require(owner != address(0), "owner = zero address");
            return _balanceOf[owner];
        }

        function setApprovalForAll(address operator, bool approved) external {
            isApprovedForAll[msg.sender][operator] = approved;
            emit ApprovalForAll(msg.sender, operator, approved);
        }

        function approve(address spender, uint id) external {
            address owner = _ownerOf[id];
            require(
                msg.sender == owner || isApprovedForAll[owner][msg.sender],
                "not authorized"
            );

            _approvals[id] = spender;

            emit Approval(owner, spender, id);
        }

        function getApproved(uint id) external view returns (address) {
            require(_ownerOf[id] != address(0), "token doesn't exist");
            return _approvals[id];
        }

        function _isApprovedOrOwner(address owner, address spender, uint id) internal view returns (bool) {
            return (spender == owner || isApprovedForAll[owner][spender] || spender == _approvals[id]);
        }

        function transferFrom(address from, address to, uint id) public {
            require(from == _ownerOf[id], "from != owner");
            require(to != address(0), "transfer to zero address");

            _balanceOf[from]--;
            _balanceOf[to]++;
            _ownerOf[id] = to;

            delete _approvals[id];

            emit Transfer(from, to, id);
        }

        function safeTransferFrom(address from, address to, uint id) external {
            transferFrom(from, to, id);

            require(
                to.code.length == 0 ||
                    IERC721Receiver(to).onERC721Received(msg.sender, from, id, "") ==
                    IERC721Receiver.onERC721Received.selector,
                "unsafe recipient"
            );
        }

        function safeTransferFrom(
            address from,
            address to,
            uint id,
            bytes calldata data
        ) external {
            transferFrom(from, to, id);

            require(
                to.code.length == 0 ||
                    IERC721Receiver(to).onERC721Received(msg.sender, from, id, data) ==
                    IERC721Receiver.onERC721Received.selector,
                "unsafe recipient"
            );
        }

        function _mint(address to, uint id) internal {
            require(to != address(0), "mint to zero address");
            require(_ownerOf[id] == address(0), "already minted");

            _balanceOf[to]++;
            _ownerOf[id] = to;

            emit Transfer(address(0), to, id);
        }

        function _burn(uint id) internal {
            address owner = _ownerOf[id];
            require(owner != address(0), "not minted");

            _balanceOf[owner] -= 1;

            delete _ownerOf[id];
            delete _approvals[id];

            emit Transfer(owner, address(0), id);
        }
    }


    contract Card is ERC721 {
        string private nameCard;
        string private imageURI; 
        uint private cardId;    

        constructor(string memory _nameCard, string memory _imageURI, uint _cardId, address creator) {
            nameCard = _nameCard;
            imageURI = _imageURI;
            cardId = _cardId;
            _mint(creator, _cardId);  // Propriétaire assigné lors de la création
        }   

        function getIdCard() public view returns (uint) {
            return cardId;
        }   

        function getNameCard() public view returns (string memory) {
            return nameCard;
        }   

        function getImageURI() public view returns (string memory) {
            return imageURI; 
        }
    }   

